import React, { useState } from 'react';
import { 
  ShoppingCart, 
  Search, 
  Menu, 
  MapPin, 
  User, 
  Package, 
  MessageSquare,
  ChevronDown,
  Bell
} from 'lucide-react';

const Header = () => {
  const [location, setLocation] = useState('Select Location');
  const [trackingId, setTrackingId] = useState('');
  const [isLocationDropdownOpen, setIsLocationDropdownOpen] = useState(false);
  const [isCategoryDropdownOpen, setIsCategoryDropdownOpen] = useState(false);
  const [isProfileDropdownOpen, setIsProfileDropdownOpen] = useState(false);
  
  const categories = {
    emergency: [
      'First Aid',
      'Medical Supplies',
      'Emergency Food',
      'Safety Equipment',
    ],
    regular: [
      'Groceries',
      'Home Essentials',
      'Personal Care',
      'Electronics',
    ]
  };

  const handleLocationDetect = () => {
    navigator.geolocation?.getCurrentPosition(
      position => {
        setLocation('Current Location');
        setIsLocationDropdownOpen(false);
      },
      error => {
        console.error('Location error:', error);
      }
    );
  };

  return (
    <header className="w-full bg-white shadow-sm sticky top-0 z-50">
      {/* Top bar */}
      <div className="bg-gray-50 py-1">
        <div className="container mx-auto px-4 flex items-center justify-between text-sm">
          <div className="flex items-center space-x-4">
            <div className="flex items-center space-x-2">
              <span className="text-gray-600">Track Order:</span>
              <input
                type="text"
                placeholder="Enter tracking ID"
                className="px-2 py-1 rounded border text-xs w-32 focus:outline-none focus:ring-2 focus:ring-blue-500"
                value={trackingId}
                onChange={(e) => setTrackingId(e.target.value)}
              />
            </div>
            <button className="text-blue-600 hover:text-blue-700 text-sm px-3 py-1">
              Track
            </button>
          </div>
          <div className="flex items-center space-x-4">
            <button className="flex items-center space-x-1 hover:text-blue-600">
              <MessageSquare className="h-4 w-4" />
              <span>Chat Support</span>
            </button>
            <button className="hover:text-blue-600">
              <Bell className="h-4 w-4" />
            </button>
          </div>
        </div>
      </div>

      {/* Main header */}
      <div className="container mx-auto px-4 py-4">
        <div className="flex items-center justify-between">
          {/* Logo and Location */}
          <div className="flex items-center space-x-8">
            <h1 className="text-2xl font-bold text-blue-600">ValueCart</h1>
            
            {/* Location Dropdown */}
            <div className="relative">
              <button 
                className="flex items-center space-x-2 text-gray-600 hover:text-gray-800"
                onClick={() => setIsLocationDropdownOpen(!isLocationDropdownOpen)}
              >
                <MapPin className="h-4 w-4" />
                <span className="max-w-[150px] truncate">{location}</span>
                <ChevronDown className="h-4 w-4" />
              </button>
              
              {isLocationDropdownOpen && (
                <div className="absolute top-full left-0 mt-1 w-48 bg-white rounded-md shadow-lg py-1 z-50">
                  <button
                    className="w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                    onClick={handleLocationDetect}
                  >
                    Detect Current Location
                  </button>
                  <button
                    className="w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                    onClick={() => {
                      setLocation('New York');
                      setIsLocationDropdownOpen(false);
                    }}
                  >
                    New York
                  </button>
                  <button
                    className="w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                    onClick={() => {
                      setLocation('Los Angeles');
                      setIsLocationDropdownOpen(false);
                    }}
                  >
                    Los Angeles
                  </button>
                </div>
              )}
            </div>
          </div>

          {/* Search Bar */}
          <div className="hidden md:flex flex-1 max-w-2xl mx-8">
            <div className="relative w-full">
              <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400 h-4 w-4" />
              <input
                type="text"
                placeholder="Search products..."
                className="w-full pl-10 pr-4 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
              />
            </div>
          </div>

          {/* Navigation and Actions */}
          <div className="flex items-center space-x-6">
            {/* Categories Dropdown */}
            <div className="hidden md:block relative">
              <button
                className="flex items-center space-x-1 hover:text-blue-600"
                onClick={() => setIsCategoryDropdownOpen(!isCategoryDropdownOpen)}
              >
                <span>Categories</span>
                <ChevronDown className="h-4 w-4" />
              </button>
              
              {isCategoryDropdownOpen && (
                <div className="absolute top-full right-0 mt-1 w-48 bg-white rounded-md shadow-lg py-1 z-50">
                  <div className="font-semibold text-red-600 px-4 py-2 text-sm">Emergency</div>
                  {categories.emergency.map((item) => (
                    <button
                      key={item}
                      className="w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                    >
                      {item}
                    </button>
                  ))}
                  <div className="font-semibold text-blue-600 px-4 py-2 text-sm">Regular</div>
                  {categories.regular.map((item) => (
                    <button
                      key={item}
                      className="w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                    >
                      {item}
                    </button>
                  ))}
                </div>
              )}
            </div>

            {/* User Profile Dropdown */}
            <div className="relative">
              <button
                className="p-2 hover:bg-gray-100 rounded-full"
                onClick={() => setIsProfileDropdownOpen(!isProfileDropdownOpen)}
              >
                <User className="h-5 w-5" />
              </button>
              
              {isProfileDropdownOpen && (
                <div className="absolute top-full right-0 mt-1 w-48 bg-white rounded-md shadow-lg py-1 z-50">
                  <button className="w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100">
                    Profile
                  </button>
                  <button className="w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100 flex items-center">
                    <Package className="h-4 w-4 mr-2" />
                    My Orders
                  </button>
                  <button className="w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100">
                    Settings
                  </button>
                  <button className="w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100">
                    Logout
                  </button>
                </div>
              )}
            </div>

            {/* Cart */}
            <button className="p-2 hover:bg-gray-100 rounded-full relative">
              <ShoppingCart className="h-5 w-5" />
              <span className="absolute -top-2 -right-2 bg-blue-600 text-white text-xs rounded-full h-4 w-4 flex items-center justify-center">
                0
              </span>
            </button>

            {/* Mobile Menu */}
            <button className="p-2 hover:bg-gray-100 rounded-full md:hidden">
              <Menu className="h-5 w-5" />
            </button>
          </div>
        </div>
      </div>

      {/* Mobile Search */}
      <div className="md:hidden px-4 pb-4">
        <div className="relative">
          <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400 h-4 w-4" />
          <input
            type="text"
            placeholder="Search products..."
            className="w-full pl-10 pr-4 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>
      </div>
    </header>
  );
};

export default Header;
